import React from 'react'

class LawTexts extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            firstCountry: props.firstCountry,
            secondCountry: props.secondCountry
        }
    }
    render(){
        return(
            <div>
                You selected {this.state.firstCountry} and {this.state.secondCountry}.
            </div>
        )
    }
}

export default LawTexts
